import React from 'react';
import './Dashboard.css'; // Make sure to create a Dashboard.css file for styling

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>Overview</h1>

      <section className="priority-tasks">
        <h2>Priority Tasks</h2>
        {/* Task list components or elements go here */}
      </section>

      <div className="analytics-calendar-container">
        <section className="task-analytics">
          <h2>Task Analytics</h2>
          {/* Insert your analytics graph here */}
        </section>

        <section className="calendar">
          <h2>Calendar</h2>
          {/* Insert your calendar component or widget here */}
        </section>
      </div>

      <div className="view-reports">
        {/* Link or button to view reports */}
        <button>View reports here</button>
      </div>
    </div>
  );
};

export default Dashboard;
